import styled from 'styled-components'
import StyledCard from '../GenericStyledComponents/StyledCard'

const NewSessionDoctorCardStyled = styled(StyledCard)``

const Name = styled.div`
    width: 25%;
`

const Type = styled.div`
    width: 25%;
`

const AvailableDays = styled.div`
    width: 50%;
`

export default { NewSessionDoctorCardStyled, Name, Type, AvailableDays }
